import IndexPage from './Pages/IndexPage.js';
import './App.css';


function App() {
  return (
    <Routes>
      <Route path='/' element={<Layout />}>
        <Route index element={<IndexPage />} />
        {/* <Route path='/login' element={<Login />} /> */}
      </Route>
    </Routes>
  );
}

export default App;
